	"ui5/rest/restwithui5/view/Form.view.xml":'<mvc:View\n    controllerName="ui5.rest.restwithui5.controller.Form"\n    xmlns:mvc="sap.ui.core.mvc"\n    xmlns="sap.m"\n    xmlns:c="sap.ui.core"\n    displayBlock="true"\n    busyIndicatorDelay="0"\n><VBox\n        class="mx-auto"\n        width="100%"\n        backgroundDesign="Solid"\n    ><Title\n            text="{data>/greetings} {i18n>FormView.TravelerBeginYourSearchBelow}"\n            class="capitalizeText sapUiTinyMarginBottom"\n        /><mvc:XMLView viewName="ui5.rest.restwithui5.view.Underline" /><HBox\n            class="sapUiMediumMarginTop sapUiSmallMarginBottom gap-2 "\n            justifyContent="Center"\n            backgroundDesign="Solid"\n            wrap="Wrap"\n            width="100%"\n        ><VBox><Label text="Source" /><SearchField\n                    value="{= (${/srcAirport/airportName}) ? ${/srcAirport/city} + \' (\' + ${/srcAirport/airportCode} + \')\' : \'\'}"\n                    showSearchButton="false"\n                    id="searchSrcAirport"\n                    placeholder="Search Airport"\n                    enableSuggestions="true"\n                    suggest=".onSuggest"\n                    suggestionItems="{\n\t\t\t\tpath: \'/suggestedAirports\',\n\t\t\t\tsorter: { path: \'city\' }\n\t\t\t}"\n                    width="100%"\n                ><layoutData><FlexItemData maxWidth="400px" /></layoutData><SuggestionItem\n                        key="{airportCode}"\n                        text="{city} ({airportCode})"\n                        description="{airportName}"\n                    /></SearchField></VBox><VBox><Label text="Destination" /><SearchField\n                    value="{= (${/destAirport/airportName}) ? ${/destAirport/city} + \' (\' + ${/destAirport/airportCode} + \')\' : \'\'}"\n                    showSearchButton="false"\n                    id="searchDestAirport"\n                    placeholder="Search Airport"\n                    enableSuggestions="true"\n                    suggest=".onSuggest"\n                    suggestionItems="{\n\t\t\t\tpath: \'/suggestedAirports\',\n\t\t\t\tsorter: { path: \'city\' }\n\t\t\t}"\n                    width="100%"\n                ><SuggestionItem\n                        key="{airportCode}"\n                        text="{city} ({airportCode})"\n                        description="{airportName}"\n                    /></SearchField></VBox><VBox width="100%"><layoutData><FlexItemData maxWidth="200px" /></layoutData><Label text="Date" /><DatePicker\n                    value="{\n\t\t\t\tpath: \'/date\',\n\t\t\t\ttype: \'sap.ui.model.type.Date\',\n\t\t\t\tformatOptions: {\n                    style: \'short\',\n\t\t\t\t\tsource: {pattern: \'yyyy-MM-dd\'}\n\t\t\t\t}}"\n                    id="departureDate"\n                /></VBox><VBox\n                justifyContent="End"\n                width="100%"\n            ><layoutData><FlexItemData maxWidth="150px" /></layoutData><Button\n                    text="{i18n>FormView.SearchFlights}"\n                    iconFirst="false"\n                    icon="sap-icon://search"\n                    type="Emphasized"\n                    width="100%"\n                    press="onSearchFlightsButtonPress"\n                /></VBox></HBox></VBox></mvc:View>\n',
